contracts/LMNTL.sol.content:
pragma solidity ^0.8.0;
import "../@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "../@openzeppelin/contracts/utils/math/SafeMath.sol";
import "../@openzeppelin/contracts/utils/Counters.sol";
import "../@openzeppelin/contracts/interfaces/IERC721.sol";
import "../@openzeppelin/contracts/token/ERC1155/IERC1155.sol";


contract LMNTL is ERC1155 {
    using SafeMath for uint256;
    using Counters for Counters.Counter;

    string private _name = "LMNTL";
    string private _symbol = "LMNTL";

    string public constant INTERFACE_ID_ERC1155 = "0x780e9d63";

    constructor() ERC1155(INTERFACE_ID_ERC1155) {
        _name = _name;
        _symbol = _symbol;
        // Initialize the token URI
        _setURI("https://ipfs.io/ipfs/Qmc3L5TFsFoQqQBpUXLgtNwECXrPXU8MdA6TZV7ZEWkMmf");
    }

    // Define the structure for character traits
    struct Character {
        uint256 level;
        uint256 exp;
        uint256 creativity;
        uint256 cunning;
        uint256 charisma;
        uint256 patience;
        uint256 fire;
        uint256 water;
        uint256 air;
        uint256 earth;
        string imageURI;
    }


    // Store the characters in a mapping
    mapping (uint256 => Character) public characters;


    // Create a counter for the NFTs
    Counters.Counter public nftCounter;
    

    uint256 constant TYPE_NF_BIT = 1 << 255;
    function isNonFungible(uint256 _id) public pure returns (bool) {
        return _id & TYPE_NF_BIT == TYPE_NF_BIT;
    }

    mapping (address => uint256[]) public tokenOwners;

    // Function to mint a new character NFT
    function mint(uint256 fire, uint256 water, uint256 air, uint256 earth,
      string memory imageURI) public returns (uint256) {
        // Get the next NFT id
        nftCounter.increment();
        uint256 id = nftCounter.current();

        tokenOwners[msg.sender].push(id);

        // Mint the new NFT
        _mint(msg.sender, id, 1, abi.encode(0));

        // Set the token URI for the NFT
        _setURI(imageURI);


        // set the token metadata
        setMetadata(id, imageURI);

        // Store the character's properties with all stats starting at 0
        characters[id] = Character({
            level: 1,
            exp: 0,
            creativity: 1 + random(1) + (water * 2),
            cunning: 1 + random(1) + (air * 2),
            charisma: 1 + random(1) + (fire * 2),
            patience: 1 + random(1) + (earth * 2),
            fire: fire,
            water: water,
            air: air,
            earth: earth,
            imageURI: imageURI
        });

        // Return the current value of nftCounter
        return nftCounter.current();
    }

    // Function to change the URI of a character NFT's image
    function changeImageURI(uint256 id, string memory newImageURI) public {
        // Ensure that the NFT with the given id exists
        require(isNonFungible(id), "The NFT does not exist");

        // Update the character's image URI
        characters[id].imageURI = newImageURI;

        // Update the token URI for the NFT
        _setURI(newImageURI);
    }


    // Function to update the traits of a character
    function updateCharacter(uint256 id, uint256 level, uint256 exp,
      uint256 creativity, uint256 cunning, uint256 charisma, uint256 patience, 
      uint256 fire, uint256 water, uint256 air, uint256 earth) public {
        // Ensure that the NFT with the given id exists
        require(isNonFungible(id), "The NFT does not exist");

        // Update the character's traits
        characters[id].level = level;
        characters[id].exp = exp;
        characters[id].creativity = creativity;
        characters[id].cunning = cunning;
        characters[id].charisma = charisma;
        characters[id].patience = patience;
        characters[id].fire = fire;
        characters[id].water = water;
        characters[id].air = air;
        characters[id].earth = earth;
    }

    function levelUp(address _userAddress, string memory imageURI) public {
        // Ensure that the NFT with the given id exists
        uint256 id = getUserTokenID(_userAddress);

        // Set the token URI for the NFT
        //changeImageURI(id, imageURI);

        // set the token metadata
        setMetadata(id, imageURI);

        // Update the character's traits
        characters[id].level += 1;
        characters[id].exp += (100 * characters[id].level);
        characters[id].fire += (characters[id].fire + random(1 + characters[id].fire));
        characters[id].water += (characters[id].water + random(1 + characters[id].water));
        characters[id].air += (characters[id].air + random(1 + characters[id].air));
        characters[id].earth += (characters[id].earth + random(1 + characters[id].earth));
        characters[id].creativity += (characters[id].level + characters[id].water + random(3 + characters[id].water));
        characters[id].cunning += (characters[id].level + characters[id].air + random(3 + characters[id].air));
        characters[id].charisma += (characters[id].level + characters[id].fire + random(3 + characters[id].fire));
        characters[id].patience += (characters[id].level + characters[id].earth + random(3 + characters[id].earth));
    }

    // Functions for updating and getting the tokenMetadata
    mapping (uint256 => string) public tokenMetadata;

    function setMetadata(uint256 _tokenId, string memory _metadata) public {
        tokenMetadata[_tokenId] = _metadata;
    }

    function getMetadata(uint256 _tokenId) public view returns (string memory) {
        return tokenMetadata[_tokenId];
    }

    function getUserTokenID(address _userAddress) public view returns (uint256 largestTokenId) {
        uint256[] memory tokenIds = tokenOwners[_userAddress];

        if (tokenIds.length == 0) {
            return (0);
        }

        largestTokenId = tokenIds[0];
        for (uint256 i = 1; i < tokenIds.length; i++) {
            if (tokenIds[i] > largestTokenId) {
                largestTokenId = tokenIds[i];
            }
        }
        return(largestTokenId);
    }

    function getStats(uint256 _tokenId) public view returns (uint256 id, 
      uint256 level, uint256 exp,
      uint256 creativity, uint256 cunning, uint256 charisma, uint256 patience, 
      uint256 fire, uint256 water, uint256 air, uint256 earth) {
        id = _tokenId;
        level = characters[id].level;
        exp = characters[id].exp;
        creativity = characters[id].creativity;
        cunning = characters[id].cunning;
        charisma = characters[id].charisma;
        patience = characters[id].patience;
        fire = characters[id].fire;
        water = characters[id].water;
        air = characters[id].air;
        earth = characters[id].earth;
        return(id, level, exp, creativity, cunning, charisma, patience, fire, water, air, earth);
    }

    function getUserMetadata(address _userAddress) public view returns (string memory metadataUri) {
        metadataUri = getMetadata(getUserTokenID(_userAddress));
        return(metadataUri);
    }

    function getUserStats(address _userAddress) public view returns (uint256 id, 
      uint256 level, uint256 exp,
      uint256 creativity, uint256 cunning, uint256 charisma, uint256 patience, 
      uint256 fire, uint256 water, uint256 air, uint256 earth) {
        return getStats(getUserTokenID(_userAddress));
    }

    function random(uint256 max) public view returns (uint256 randomInt) {
        randomInt = uint256(keccak256(abi.encodePacked(block.timestamp, blockhash(block.number - 1)))) % max;
        return randomInt;
    }
}

